import changeTodoDescription from '../actions/createTodoActions/changeTodoDescription.action';
import changeTodoResponsible from '../actions/createTodoActions/changeTodoResponsible.action';
import changeTodoPriority from '../actions/createTodoActions/changeTodoPriority.action';
import changeTodoCompleted from '../actions/editTodo.actions';
import fetchTodo from '../actions/editTodo.actions';

const editTodoContainer = {
    mapStateToProps: state => ({
        todoPriority: state.editTodo.todoPriority,
        todoDescription: state.editTodo.todoDescription,
        todoResponsible: state.editTodo.todoResponsible,
        todoCompleted: state.editTodo.todoCompleted,
        fetched: false,
    }),
    mapDispatchToProps: dispatch => ({
            changeTodoDescription: (event) => dispatch(changeTodoDescription(event)),
            changeTodoResponsible: (event) => dispatch(changeTodoResponsible(event)),
            changeTodoPriority: (event) => dispatch(changeTodoPriority(event)),
            changeTodoCompleted: (event) => dispatch(changeTodoCompleted(event)),
            fetchTodo: (id) => dispatch(fetchTodo(id)),
            update: () => dispatch({type: 'update'}),
            changeStatusFetch: () => dispatch({type: 'changeStatusFetch'}),
    })
}

export default editTodoContainer;
